import React, { useState } from "react";
import "./Menu.css";

const Menu = () => {
	const [selectedCategory, setSelectedCategory] = useState("All");

	const menuItems = [
		{
			name: "Moong Dal Pakoda",
			price: "₹40",
			img: "https://via.placeholder.com/150",
			category: "Veg Snacks",
		},
		{
			name: "Non-Veg Dish 1",
			price: "₹15.99",
			img: "https://via.placeholder.com/150",
			category: "Veg Snacks",
		},
		{
			name: "Starters 1",
			price: "₹10.99",
			img: "https://via.placeholder.com/150",
			category: "Veg Snacks",
		},
		{
			name: "Veg Dish 2",
			price: "₹9.99",
			img: "https://via.placeholder.com/150",
			category: "Veg Meals",
		},
		{
			name: "Snack 1",
			price: "₹14.99",
			img: "https://via.placeholder.com/150",
			category: "Veg Meals",
		},
		{
			name: "Non-Veg Dish 2",
			price: "₹16.99",
			img: "https://via.placeholder.com/150",
			category: "Veg Meals",
		},
		{
			name: "Starters 2",
			price: "₹11.99",
			img: "https://via.placeholder.com/150",
			category: "Veg Meals",
		},
		{
			name: "Snack 2",
			price: "₹13.99",
			img: "https://via.placeholder.com/150",
			category: "Veg Meals",
		},
		{
			name: "Veg Dish 3",
			price: "₹8.99",
			img: "https://via.placeholder.com/150",
			category: "Non Veg Snacks",
		},
		{
			name: "Veg Dish 3",
			price: "₹8.99",
			img: "https://via.placeholder.com/150",
			category: "Non Veg Snacks",
		},
		{
			name: "Veg Dish 3",
			price: "₹8.99",
			img: "https://via.placeholder.com/150",
			category: "Non Veg Snacks",
		},
		{
			name: "Veg Dish 3",
			price: "₹8.99",
			img: "https://via.placeholder.com/150",
			category: "Tea Time Snacks",
		},
		{
			name: "Veg Dish 3",
			price: "₹8.99",
			img: "https://via.placeholder.com/150",
			category: "Tea Time Snacks",
		},
		{
			name: "Veg Dish 3",
			price: "₹8.99",
			img: "https://via.placeholder.com/150",
			category: "Tea Time Snacks",
		},
		{
			name: "Veg Dish 3",
			price: "₹8.99",
			img: "https://via.placeholder.com/150",
			category: "Masalas",
		},
		{
			name: "Veg Dish 3",
			price: "₹8.99",
			img: "https://via.placeholder.com/150",
			category: "Masalas",
		},
	];

	// Filter menu items based on the selected category
	const filteredItems =
		selectedCategory === "All"
			? menuItems
			: menuItems.filter((item) => item.category === selectedCategory);

	return (
		<div className="menu">
			<div className="menu-filter">
				<button
					onClick={() => setSelectedCategory("All")}
					className={`filter-button ${
						selectedCategory === "All" ? "active" : ""
					}`}
				>
					All
				</button>
				<button
					onClick={() => setSelectedCategory("Veg")}
					className={`filter-button ${
						selectedCategory === "Veg Snacks" ? "active" : ""
					}`}
				>
					Veg
				</button>
				<button
					onClick={() => setSelectedCategory("Non-Veg")}
					className={`filter-button ${
						selectedCategory === "Non-Veg Snacks" ? "active" : ""
					}`}
				>
					Non-Veg
				</button>
				<button
					onClick={() => setSelectedCategory("Starters")}
					className={`filter-button ${
						selectedCategory === "Starters" ? "active" : ""
					}`}
				>
					Starters
				</button>
				<button
					onClick={() => setSelectedCategory("Snacks")}
					className={`filter-button ${
						selectedCategory === "Snacks" ? "active" : ""
					}`}
				>
					Snacks
				</button>
			</div>

			<div className="menu-grid">
				{filteredItems.map((item, index) => (
					<div className="menu-item" key={index}>
						<img src={item.img} alt={item.name} className="menu-image" />
						<h3 className="menu-name">{item.name}</h3>
						<p className="menu-price">{item.price}</p>
					</div>
				))}
			</div>
		</div>
	);
};

export default Menu;
